function contactsRequestCall(){$(document).ready(function(){$(".contacts-request-call__form>form").submit(function(t){t.preventDefault();var e=$(this);$.ajax({type:e.attr("method"),url:e.attr("action"),data:e.serialize()}).done(function(){document.body.style.overflow="hidden",$(".complete-modal").fadeIn(200),$("#call-back__user-phone").val("")})})})}contactsRequestCall();